import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import StudentAssignment from "../Assignment/StudentAssignment";
import StudentExam from "../Exam/StudentExam";
import StudentFee from "../Fee/StudentFee";
import StudentHome from "../Home/StudentHome"
import StudentSubject from "../Subject/StudentSubject";
import StudentTeacher from "../Teacher/StudentTeacher";
import StudentNotice from "../Notice/StudentNotice"
import Layout from "./Layout";

function Routes() {
  return (
    <>
      <Router>
        <Route render={(props)=>(
            <Layout {...props}>
                <Switch>
                    <Route exact path="/teacherhome" component={TeacherHome} />
                    <Route path="/teacherstudent" component={TeacherStudent} />
                    <Route exact path="/teacherassignment" component={TeacherAssignment} />
                    <Route exact path="/teacherexam" component={TeacherExam} />
                    <Route exact path="/teachersubject" component={TeacherSubject} />
                    <Route exact path="/teachermail" component={TeacherMail} />
                    <Route exact path="/teachernotice" component={TeacherNotice} />
                    <Redirect to="/teacher" />
                </Switch>
            </Layout>
        )}/>
      </Router>
    </>
  );
}

export default Routes;
